import React from 'react';
import logo from './logo.svg';
import './App.css';
import axios from 'axios';

const TEXTURL = "localhost:8080/test";

function App() {

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <button onClick="getText">Show Backend Text</button>
      </header>
    </div>
  );
}

export default App;
